// import Header from "./components/Header";
import "./App.scss";

function App() {
  return (
    <header className="header">
      <a href="">
        <img
          src={require("../Assets/Logo/BrainFlix-logo.svg").default}
          alt={"BrainFlix"}
        />
      </a>
      <form>
        <label for="search">
          <input type="text" placeholder="Search" />
          <button>
            <img
              className="header__search-input"
              src={require("./Assets/Icons/upload.svg").default}
              alt="search icon"
            />
            UPLOAD
          </button>
        </label>
      </form>
      <img
        className="header__login-avatar"
        src={require("../Assets/Images/Mohan-muruge.jpg").default}
        alt="Login Avatar"
      />
    </header>
  );
}

export default App;
